INSERT INTO `protectora` (`id`, `nombre`, `ciudad`, `imagen`, `email`, `password`, `direccion`, `telefono`, `pendiente`, `descripcion`, `estado`, `latitud`, `longitud`) VALUES
(2, 'S.P.A.P.', 'Madrid', , 'spap@gmail.com', '1234', 'Princesa, 12', 901123456, 0, 'Toda una vida dedicada a los animales y al medio ambiente. La Sociedad Protectora de Animales y Plantas de Madrid lleva trabajando más \r\nde setenta y cinco años para estimular el respeto, cuidado y cariño por los animales y por el medio ambiente. ', 1, 40.4245482, -3.712454600000001);
